import React from "react";
import classes from "./Header.module.css";
import {TbUserCircle} from 'react-icons/tb';
import {Link, NavLink} from "react-router-dom";


const Header = (props) => {
  return (
  
    <div className={classes.headerdiv}>
    <header className={classes.header}>
        <div className={classes.containLeft}>
        <h1 className={classes.brandName}>TaskPlanr</h1>
      <span className={classes.navlist}>
        <div  >
          <NavLink to="/homepage" className={(isActive)=>{ isActive? classes.active: undefined}} >Home</NavLink>
        </div>
        <span>
          <Link to="/tasks" className={classes.navItem}>Tasks</Link>
        </span>
        <span>
          <Link to="/tasks" className={classes.navItem}>Contact</Link>
        </span>
        <span>
          <Link to="/tasks" className={classes.navItem}>FAQs</Link>
        </span>
        
      </span>
      </div>
      <span className={classes.user}>
          <Link to="/user-profile" className={classes.navItem}>
            Thomas Parker
          </Link>
          <TbUserCircle className={classes.usericon}></TbUserCircle>
        </span>
    </header>
    </div>
  
  );
};

export default Header;
